package org.openapitools.server.model


/**
 * The response resource.
 *
 * @param id The unique ID of the response. for example: ''null''
 * @param `object` The object type, must be `realtime.response`. for example: ''null''
 * @param status The final status of the response (`completed`, `cancelled`, `failed`, or  `incomplete`).  for example: ''null''
 * @param statusDetails  for example: ''null''
 * @param output The list of output items generated by the response. for example: ''null''
 * @param metadata Developer-provided string key-value pairs associated with this response.  for example: ''null''
 * @param usage  for example: ''null''
*/
final case class RealtimeResponse (
  id: Option[String] = None,
  `object`: Option[String] = None,
  status: Option[String] = None,
  statusDetails: Option[RealtimeResponseStatusDetails] = None,
  output: Option[Seq[RealtimeConversationItem]] = None,
  metadata: Option[Any] = None,
  usage: Option[RealtimeResponseUsage] = None
)

